import React from 'react'
import { useState } from 'react';
import { Typography, AppBar, Toolbar, CssBaseline, Button, Grid} from '@mui/material'


const Header = () => {

  const pages = {'Portfolio': 'https://www.google.com/', 'Github': 'https://github.com/dnnysoftware'};
  const [setAnchorElNav] = useState(null);

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };


  return (
      <CssBaseline>
        <AppBar position='relative'>
          <Toolbar>
            <Grid container alignItems='center' justify='space-between'>
              <Grid item xs={12} md={8}>
                <Typography variant='h4'>Daniel's Translator Web App</Typography>
              </Grid>
              <Grid item xs={12} md={6}>
                {Object.entries(pages).map(([key, value]) => (
                  <Button
                    key={key}
                    onClick={handleCloseNavMenu}
                    sx={{ my: 2, color: 'white'}}
                    href={value}
                  >
                    {key}
                  </Button>
                ))}
              </Grid>
            </Grid>
          </Toolbar>
        </AppBar>
      </CssBaseline>
  )
}

export default Header
